package net.wanho.po.person;

import java.util.Date;

/**
 * 个人日程
 * @author Administrator
 *
 */
public class Canvas {
	/**日程编码*/
	private Integer canvasId; 
	/**员工编码*/
	private Integer employeeId; 
	/**代办日期*/
	private Date commission; 
	/**代办事件描述*/
	private String description; 
	/**事件状态*/
	private Integer status; 
	/**创建时间*/
	private Date createTime;
	public Canvas() {
		super();
		// TODO Auto-generated constructor stub
	}
	public Canvas(Integer canvasId, Integer employeeId, Date commission, String description, Integer status,
			Date createTime) {
		super();
		this.canvasId = canvasId;
		this.employeeId = employeeId;
		this.commission = commission;
		this.description = description;
		this.status = status;
		this.createTime = createTime;
	}
	public Integer getCanvasId() {
		return canvasId;
	}
	public void setCanvasId(Integer canvasId) {
		this.canvasId = canvasId;
	}
	public Integer getEmployeeId() {
		return employeeId;
	}
	public void setEmployeeId(Integer employeeId) {
		this.employeeId = employeeId;
	}
	public Date getCommission() {
		return commission;
	}
	public void setCommission(Date commission) {
		this.commission = commission;
	}
	public String getDescription() {
		return description;
	}
	public void setDescription(String description) {
		this.description = description;
	}
	public Integer getStatus() {
		return status;
	}
	public void setStatus(Integer status) {
		this.status = status;
	}
	public Date getCreateTime() {
		return createTime;
	}
	public void setCreateTime(Date createTime) {
		this.createTime = createTime;
	}
	@Override
	public String toString() {
		return "Canvas [canvasId=" + canvasId + ", employeeId=" + employeeId + ", commission=" + commission
				+ ", description=" + description + ", status=" + status + ", createTime=" + createTime + "]";
	}
	
	
}
